import React from 'react';
import TodoElement from './TodoElement';

export default function TodoContainer(props: any) {
  return (
    <table>
      <tr>
        <th>Todo Title</th>
        <th>Description</th>
        <th>Actions</th>
      </tr>
      {props}
      <TodoElement />
    </table>
  );
}
